import '../Components/Root/Reset.css'




import Pdv from "./Pdv"

import { BrowserRouter, Routes, Route, Link } from 'react-router-dom'

export default function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<App />} ></Route>
          <Route path="/home" element={<Pdv />} ></Route>
        </Routes>
      </BrowserRouter>

    </>
  );
}

function pagina(){
  return(
    <>
    <Header />
    <Apresentacao />
    <Footer />
    </>
  )
}
